import { Component } from '@angular/core';
import { Platform, MenuController, ModalController, AlertController } from '@ionic/angular';
import { Plugins } from '@capacitor/core';
import { DataService } from './services/data.service';
const { App } = Plugins;

@Component({
	selector: 'app-root',
	templateUrl: 'app.component.html',
	styleUrls: ['app.component.scss'],
})
export class AppComponent {
	base64Image = 'data:image/png;base64,';
	constructor(public alertCtrl: AlertController, private platform: Platform, private dataService: DataService) {

		this.platform.backButton.subscribeWithPriority(10, () => {
			this.exitalertopen();
		});

		this.platform.ready().then(()=> {
			this.dataService.addData(this.base64Image);
		}).catch((e)=> {
			console.log(e);
		});

	}

	public async exitalertopen() {
		const alert = await this.alertCtrl.create({
			header: "Confirm!",
			message: "Are you sure you want to exit?",
			buttons: [
				{
					text: "Cancel",
					cssClass: "secondary",
					handler: (blah) => { },
				},
				{
					text: "Exit",
					handler: () => {
						App.exitApp();
						return false;
					},
				},
			],
		});
		await alert.present();
	}
}
